import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';
import Team from '../Team';
import About from '../About';
import Whyus from '../Whyus';

function Home() {
  return (
    <>
      <HeroSection />
      <About />
      <Cards />
      <Whyus />
      <Team />
      <Footer />
    </>
  );
}

export default Home;
